import * as BlenderImage from './Components/Images/BlenderImage.jpg';
import * as OvenImage from './Components/Images/OvenImage.jpg';
import * as FridgeImage from './Components/Images/FridgeImage.jpg';
import * as FanImage from './Components/Images/FanImage.jpg';

function App() {
  const items = [
    {date : new Date (2022,2,26) ,
      title : 'Oven' ,
      price : 150 ,
      image : OvenImage},

    {date : new Date (2022,4,15) ,
      title : "Hand Blender" ,
      price : 45 ,
      image : BlenderImage},

    {date : new Date (2022,6,8) ,
      title : "Fridge" ,
      price : 500 ,
      image : FridgeImage},

    {date : new Date (2022,11,14) ,
      title : "Fan" ,
      price : 70 ,
      image : FanImage}
  ];

  return (
    <div>
      <h2> Hello Shamousa Let's Goo </h2>
      <Component1 
        date = {items[0].date}
        title = {items[0].title}
        image = {items[0].image}
        price = {items[0].price}        
      />
      <Component1 
        date = {items[1].date}
        title = {items[1].title}
        image = {items[1].image}
        price = {items[1].price}        
      />
      <Component1 
        date = {items[2].date}
        title = {items[2].title}
        image = {items[2].image}
        price = {items[2].price}        
      />
      <Component1 
        date = {items[3].date}
        title = {items[3].title}
        image = {items[3].image}
        price = {items[3].price}        
      />
    </div>
  );
}

export default App;
